import React, {Component} from 'react';
import Carousel from 'react-bootstrap/Carousel';
import {CarouselItem} from "react-bootstrap";
import q123 from '../assets/123.jpg'
import q122 from '../assets/122.jpg'
class CarouselBox extends Component {
    render() {
        return (
            <Carousel>
                <Carousel.Item>
                    <img
                        className="d-block w-100"
                        src={q123}
                        alt="Тимон"
                    />
                    <Carousel.Caption>
                        <h3>Timon image</h3>
                        <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Excepturi, soluta.</p>
                    </Carousel.Caption>
                </Carousel.Item>
                <Carousel.Item>
                    <img
                        className="d-block w-100"
                        src={q122}
                        alt="Const"
                    />
                    <Carousel.Caption>
                        <h3>Const image</h3>
                        <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Dolore, sapiente.</p>
                    </Carousel.Caption>
                </Carousel.Item>

            </Carousel>
        );
    }
}

export default CarouselBox;
